import React from "react";
import styled from "styled-components";

export default function TreatmentDetailsContainer() {
  return (
    <MainContainer>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
      <h1>Prithvi Singh Raikwal</h1>
    </MainContainer>
  );
}

const MainContainer = styled.div`
  width: 90%;
  position: relative;
  left: 80px;
  top: 40px;
  text-align: center;
  border: 2px solid crimson;
`;
